  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Trustee Program's duties
  include approving nonprofit budget and credit counseling agencies (credit counseling
  agencies) for inclusion on a publicly available list of approved credit counseling
  agencies. If a United States Trustee decides not to approve or to remove a credit
  counseling agency from the approved list, that credit counseling agency may obtain
  administrative review of the decision from the Executive Office for U.S. Trustees.
  This link provides a copy of the Executive Office's administrative decisions, although
  certain information has been redacted\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
